import nltk
import re
import numpy as np

from sklearn.preprocessing import normalize

from scipy.sparse import csr_matrix, spdiags, hstack, csr_array

stemmer = nltk.stem.snowball.EnglishStemmer()
TAGS = dict()
for word in VERBS:
    TAGS[stemmer.stem(word)] = "v"
    
for word in NOUNS:
    if stemmer.stem(word) in TAGS:
        TAGS[stemmer.stem(word)] += "n"
    else:
        TAGS[stemmer.stem(word)] = "n"

for word in ADJ:
    if stemmer.stem(word) in TAGS:
        TAGS[stemmer.stem(word)] += "a"
    else:
        TAGS[stemmer.stem(word)] = "a"

for word in STOP:
    if stemmer.stem(word) in TAGS:
        TAGS[stemmer.stem(word)] += "s"
    else:
        TAGS[stemmer.stem(word)] = "s"

for word in QUESTION:
    if stemmer.stem(word) in TAGS:
        TAGS[stemmer.stem(word)] += "q"
    else:
        TAGS[stemmer.stem(word)] = "q"

for word in MODAL:
    if stemmer.stem(word) in TAGS:
        TAGS[stemmer.stem(word)] += "m"
    else:
        TAGS[stemmer.stem(word)] = "m"

tagger = nltk.tag.UnigramTagger(model=TAGS, backoff=nltk.DefaultTagger('x'))

grammar_tag = (r"""
  QUESTION: {^<.*q.*><.*v.*><.*s.*>?<.*a.*>*<.*n.*>} #ex. What is a long answer?
  QUESTION_MODAL: {^<.*q.*><.*m.*><.*s.*>?<.*v.*>(<.*s.*>?<.*n.*>)?} #ex. How would you solve (the problem)?
  QUESTION2: {^<.*v.*><.*q.*><.*s.*>?<.*a.*>*<.*n.*>?<.*v.*>} #ex. Explain how you solved it.
  TASK: {<.*v.*><.*s.*>?<.*s.*>?<.*a.*>*<.*n.*>} #ex. Give me an answer.
""")

chunking_tag = nltk.RegexpParser(grammar_tag)

def to_tree(paragraph):
    sent_list = [list(map(stemmer.stem, word_list)) for word_list in list(map(nltk.word_tokenize, nltk.sent_tokenize(paragraph.lower())))]
    return nltk.tree.Tree("PARAGRAPH", list(map(chunking_tag.parse, map(tagger.tag, sent_list))))

adj_matcher = re.compile("[^/]*a[^/]*$")
def parse_sentence(sentence):
    ans = []
    for line in sentence:
        if isinstance(line, nltk.tree.Tree):
            label = line.label()

            if label == "TASK" or label == "QUESTION":
                adj = next((line[i][0] for i in range(len(line) - 2, 0, -1) if adj_matcher.search(line[i][1])), None)
                ans.append((line[0][0], line[-1][0], adj))
            elif label == "QUESTION_MODAL":
                if len(line) > 4:
                    ans.append((line[3][0], line[-1][0], None))
                elif len(line) > 3:
                    ans.append((line[0][0], line[3][0], None))
                else:
                    ans.append((line[0][0], line[2][0], None))
            elif label == "QUESTION2":
                adj = next((line[i][0] for i in range(len(line) - 1, -1, -1) if adj_matcher.search(line[i][1])), None)
                ans.append((line[0][0], line[-1][0], adj))
            
    return ans

illegal_chars_re = re.compile("[\{\}\"\'\[\]\(\)]*")
def get_paragraph_tree(paragraph):
    return to_tree(paragraph=illegal_chars_re.sub('', paragraph))

adj_decrease = set(['tini', 'scarc', 'sortof', 'just', 'small', 'kindof', 'less', 'outlin', 'compact', 'occasion', 'summar', 'sorta', 'margin', 'almost', 'short', 'slight', 'littl', 'somewhat', 'part', 'direct', 'bare', 'kinda', 'hard', 'encapsul'])
adj_increase = set(['realli', 'remark', 'larg', 'prolong', 'consider', 'high', 'most', 'particular', 'explanatori', 'pure', 'substanti', 'complet', 'more', 'enorm', 'lengthi', 'huge', 'express', 'aw', 'reveal', 'fabul', 'thorough', 'drag', 'uber', 'tremend', 'unusu', 'strike', 'deepli', 'extens', 'full', 'accur', 'fulli', 'except', 'quit', 'great', 'intens', 'vivid', 'eloqu', 'decid', 'precis', 'extend', 'detail', 'descript', 'unbeliev', 'elabor', 'veri', 'incred', 'especi', 'absolut', 'utter', 'amaz', 'last', 'entir', 'illustr', 'extrem', 'total', 'long', 'comprehens', 'major', 'clear'])


def count_paragraphs(paragraphs, vocabulary_verbs, vocabulary_nouns, vocabulary_pairs, vocabulary_triple, vocabulary_triple_inc_dec, vocabulary_adj):
    j_indices_verbs = []
    j_indices_nouns = []
    j_indices_pairs = []
    j_indices_triple = []
    j_indices_triple_inc_dec = []
    j_indices_adj = []
    indptr_verbs = [0]
    indptr_nouns = [0]
    indptr_pairs = [0]
    indptr_triple = [0]
    indptr_triple_inc_dec = [0]
    indptr_adj = [0]
    values_verbs = []
    values_nouns = []
    values_pairs = []
    values_triple = []
    values_triple_inc_dec = []
    values_adj = []

    vocabulary_verbs_dict = dict()
    for i, word in enumerate(vocabulary_verbs):
        vocabulary_verbs_dict[word] = i
    
    vocabulary_nouns_dict = dict()
    for i, word in enumerate(vocabulary_nouns):
        vocabulary_nouns_dict[word] = i

    vocabulary_pairs_dict = dict()
    for i, word in enumerate(vocabulary_pairs):
        vocabulary_pairs_dict[word] = i

    vocabulary_triple_dict = dict()
    for i, word in enumerate(vocabulary_triple):
        vocabulary_triple_dict[word] = i
    
    vocabulary_triple_inc_dec_dict = dict()
    for i, word in enumerate(vocabulary_triple_inc_dec):
        vocabulary_triple_inc_dec_dict[word] = i
    
    vocabulary_adj_dict = dict()
    for i, word in enumerate(vocabulary_adj):
        vocabulary_adj_dict[word] = i
    
    for i, paragraph in enumerate(paragraphs):
        verbs_found = {}
        nouns_found = {}
        pairs_found = {}
        triple_found = {}
        triple_inc_dec_found = {}
        adj_found = {}

        for sentence_nr, sentence in enumerate(paragraph):
            pairs = parse_sentence(sentence=sentence)
            sentence_weight = 2*abs(1 + sentence_nr - len(paragraph)/2)/len(paragraph)
            sentence_weight = sentence_weight * sentence_weight + 1
            for j, pair in enumerate(pairs):
                pair_new = pair[0]+","+pair[1]
                if pair_new in vocabulary_pairs_dict:
                    idx = vocabulary_pairs_dict[pair_new]
                    if idx in pairs_found:
                        pairs_found[idx] += sentence_weight
                    else:
                        pairs_found[idx] = sentence_weight
                if pair[2] is not None:
                    triple = None
                    if pair[2] in adj_increase:
                        triple = pair[0]+",INC,"+pair[1]
                    if pair[2] in adj_decrease:
                        triple = pair[0]+",DEC,"+pair[1]
                    if triple is not None:
                        if triple in vocabulary_triple_inc_dec_dict:
                            idx = vocabulary_triple_inc_dec_dict[triple]
                            if idx in triple_inc_dec_found:
                                triple_inc_dec_found[idx] += sentence_weight
                            else:
                                triple_inc_dec_found[idx] = sentence_weight
                    
                    triple = pair[0]+","+pair[2]+","+pair[1]
                    if triple in vocabulary_triple_dict:
                        idx = vocabulary_triple_dict[triple]
                        if idx in triple_found:
                            triple_found[idx] += sentence_weight
                        else:
                            triple_found[idx] = sentence_weight
                    
                    if pair[2] in vocabulary_adj_dict:
                        idx = vocabulary_adj_dict[pair[2]]
                        if idx in adj_found:
                            adj_found[idx] += sentence_weight
                        else:
                            adj_found[idx] = sentence_weight

                if pair[0] in vocabulary_verbs_dict:
                    idx = vocabulary_verbs_dict[pair[0]]
                    if idx in verbs_found:
                        verbs_found[idx] += sentence_weight
                    else:
                        verbs_found[idx] = sentence_weight

                if pair[1] in vocabulary_nouns_dict:
                    idx = vocabulary_nouns_dict[pair[1]]
                    if idx in nouns_found:
                        nouns_found[idx] += sentence_weight
                    else:
                        nouns_found[idx] = sentence_weight
            
        j_indices_verbs.extend(verbs_found.keys())
        values_verbs.extend(verbs_found.values())
        indptr_verbs.append(len(j_indices_verbs))

        j_indices_nouns.extend(nouns_found.keys())
        values_nouns.extend(nouns_found.values())
        indptr_nouns.append(len(j_indices_nouns))

        j_indices_pairs.extend(pairs_found.keys())
        values_pairs.extend(pairs_found.values())
        indptr_pairs.append(len(j_indices_pairs))

        j_indices_triple.extend(triple_found.keys())
        values_triple.extend(triple_found.values())
        indptr_triple.append(len(j_indices_triple))

        j_indices_triple_inc_dec.extend(triple_inc_dec_found.keys())
        values_triple_inc_dec.extend(triple_inc_dec_found.values())
        indptr_triple_inc_dec.append(len(j_indices_triple_inc_dec))

        j_indices_adj.extend(adj_found.keys())
        values_adj.extend(adj_found.values())
        indptr_adj.append(len(j_indices_adj))
    
    j_indices_verbs = np.asarray(j_indices_verbs, dtype=np.int64)
    indptr_verbs = np.asarray(indptr_verbs, dtype=np.int64)
    values_verbs = np.asarray(values_verbs, dtype=float)

    result_verbs = csr_matrix(
        (values_verbs, j_indices_verbs, indptr_verbs),
        shape=(len(indptr_verbs) - 1, len(vocabulary_verbs)),
        dtype=float,
    )
    result_verbs.sort_indices()
        
    j_indices_nouns = np.asarray(j_indices_nouns, dtype=np.int64)
    indptr_nouns = np.asarray(indptr_nouns, dtype=np.int64)
    values_nouns = np.asarray(values_nouns, dtype=float)

